import React, {Component} from 'react';
import InfoSidebarSongAdded from './InfoSidebarSongAdded';

import { PlaylistContext } from '../../../contexts/PlaylistContext';


export default class SidebarPlaylist extends Component{
    render(){
        return(
            <div className="sidebar-playlist">
                <PlaylistContext.Consumer>
                {({playlist}) => 
                (
                    playlist.map((value, index) => {
                        return <InfoSidebarSongAdded id = {value.videoID} song_title = {value.title} singer = {value.channelTitle} 
                        thumbnail = {value.thumbnails} upvote = {value.upvote} downvote = {value.downvote} key = {index} duration = {value.duration}
                        votingID ={value._id}/>
                    })
                )}
                </PlaylistContext.Consumer>
            </div>

        )
    }
}
